import React, { Component } from 'react';

class WalletExpenseForm extends Component {
  render() {
    return (
      <form>
        <label
          htmlFor="expense-value"
        >
          Valor
          <input
            id="expense-value"
            type="number"
          />
        </label>
        <label
          htmlFor="expense-description"
        >
          Descrição
          <input
            id="expense-description"
            type="text"
          />
        </label>
      </form>
    );
  }
}

export default WalletExpenseForm;
